import React from 'react'
import Img from '.././general.png'

function AllExpenseDetails(props){
    function RenderMoney(){
        if(props.paid === "you paid"){
            return (
                <div>
                    <p className="">{props.paid} ${props.amount}</p>
                    <p className="recent-activity-p-2-active"> {props.lent}{props.name} ${props.amount/2}</p>
                </div>
            )
        }
        else{
            return (
                <div>
                    <p className="recent-activity-p-2">{props.name}{props.paid} ${props.amount}</p>
                    <p className="recent-activity-p-2-active">{props.name} {props.lent} ${props.amount/2}</p>
                </div>
            )
        }
    }
    return(
        <div>
            <div className="">
                <div>
                    <p className="recent-activity-p-3">{props.time}</p>
                    <img className="" src={Img} alt="poster-icon"/>
                    <p className="">{props.description}</p>
                </div>
                <RenderMoney/>
            </div>
        </div>
    )
}

export default AllExpenseDetails
